import Header from "./Header";
import { Outlet } from "react-router-dom";
import React from "react"

const DashboardLayout = () => (
  <div className="flex">
    <Sidebar />
    <div className="flex-1">
      <Header />
      <main className="p-4">
        <Outlet />
      </main>
    </div>
  </div>
);

export default DashboardLayout;
